import api from "./api";

export default class ArtworkService {
    static getExamplesData(index) {
        return api({
            method: 'GET',
            url: `https://cors-anywhere.herokuapp.com/storage.googleapis.com/ya-misc/interviews/front/examples/1.json`,
        })
    }
}
